import launchApp from './launchApp';
import { displayTasks, displayProjects, eventListeners } from './DOMevents';
import { restoreTasks, restoreProjects } from './functions';

const mainAppFunction = function mainFunction() {
  const content = document.createElement('div');
  content.classList.add('content');
  content.setAttribute('id', 'content');

  const body = document.querySelector('body');
  body.appendChild(content);

  const head = document.querySelector('head');
  const icon = document.createElement('link');
  head.appendChild(icon);
  icon.rel = 'icon';
  icon.type = 'image/png';
  icon.sizes = '16x16';
  icon.href = 'data:image/png;base64,';

  launchApp();
  restoreTasks();
  restoreProjects();
  displayTasks('');
  displayProjects();
  eventListeners();
};

export default mainAppFunction;
